svg.script:

(function() {
  var fullOpacity = 1;
  var dimOpacity = 0.3;
  var typingDuration = 2000; // 2 seconds of typing animation
  var staticDuration = 5000; // 5 seconds of static display
  var dotDelay = 300; // Delay between each dot lighting up

  var circles = [
    document.getElementById('Ellipse_1'),
    document.getElementById('Ellipse_2'),
    document.getElementById('Ellipse_3')
  ];

  // Original opacities: st0 = 1, st1 = 0.5
  var originalOpacities = [1, 1, 0.5];
  var isAnimating = false;
  var animationTimer = null;

  function resetToDefault() {
    for (var i = 0; i < circles.length; i++) {
      circles[i].style.opacity = originalOpacities[i];
    }
  }

  function pulseSequence() {
    if (!isAnimating) return;

    var dotIndex = 0;

    function pulseDot() {
      if (!isAnimating) return;

      // Dim all dots first
      for (var i = 0; i < circles.length; i++) {
        circles[i].style.opacity = dimOpacity;
      }

      // Light up current dot
      circles[dotIndex].style.opacity = fullOpacity;

      // Move to next dot
      dotIndex = (dotIndex + 1) % circles.length;

      // Continue the sequence
      animationTimer = setTimeout(pulseDot, dotDelay);
    }

    pulseDot();
  }

  function runAnimation() {
    // Start typing animation phase
    isAnimating = true;
    pulseSequence();

    // After typing duration, stop and reset to default
    setTimeout(function() {
      isAnimating = false;
      if (animationTimer) {
        clearTimeout(animationTimer);
        animationTimer = null;
      }
      resetToDefault();

      // After static duration, start again
      setTimeout(runAnimation, staticDuration);
    }, typingDuration);
  }

  // Start animation when SVG loads
  if (document.readyState === 'complete') {
    runAnimation();
  } else {
    window.addEventListener('load', runAnimation);
  }
})();
